import React from "react";
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div className="jumbotron">
      <h2>Workout React App</h2>
      <p>Sweat</p>
      <Link to="workout1" className='btn btn-primary'>About</Link>
    </div>
  );
}

export default HomePage;
